def δ (x : ℕ) : ℕ :=
  if h : x = 0 then 1
  else
    let divisors := {d ∈ Finset.filter (fun d => d % 2 = 1) (Finset.divisors x) | d ∣ x}
    in
    if divisors.nonempty then divisors.sup id else 1

def δ (x : ℕ) : ℕ :=
  if h : x ≠ 0 then
    let divisors := (Finset.filter (fun d => d % 2 = 1) (Finset.divisors x))
    divisors.max' (by simpa using h)
  else 0

def δ (x : ℕ) : ℕ :=
  Finset.max' (Finset.filter (fun d => d ∣ x ∧ d % 2 = 1) (Finset.range (x + 1))) (begin
    apply Finset.nonempty_of_mem,
    use 1,
    simp [Nat.one_dvd, Nat.odd_one],
  end)
